    name: '',
    lastname: '',
    username:'',
    password: '',
    repeatPassword: ''
  })

  const changeHandler = (e) => {
    let value = e.target.value
    let key = e.target.name
    setUser({...user, [key]: value})
  }

  console.log('!!!!!', user)

  return (
    <div>
      <Register changeHandler={changeHandler}/>
    </div>
  );
};

export default RegisterContainer;
